## Code:
#include <stdio.h>
int main(){
int n;
scanf("%d",&n);
if(n%2==0){
printf("EVEN");
}
else{
printf("ODD");
}
return 0;
}
## Pseudocode:
step-1: Start
step-2: Declare Library, function(s) (header)
step-3: Declare variables or constants
step-4: Input value (i.e "scanf("%d",&n);")
step-5: "if(n%2==0)": If input is completely divisible: Yes / no
step-6: "Yes": go to step-7 / "No": go to step-8
step-7: Print "EVEN"
step-8: Print "ODD"
step-9: "Return 0": code successfully terminated
step-10: End
